            "message": "Introduce `resolve_conflict` for `apply_type_with_promotion` (#1984)\n\n* introduce resolve_conflict for apply_type_with_promotion\n\nThis solves the issue with using promote_type previously:\n\n```\nstruct Foo{T,AT<:AbstractArray{T}}\n    a::AT\nend\n\nT_original = Foo{Float64, ConcreteRArray{Float64, 1}}\n\nT_traced = Reactant.traced_type(T_original, Reactant.ConcreteToTraced)\nReactant.TracedRArray{Float64, 1}}\n\nT_concrete = Reactant.traced_type(T_traced, Reactant.TracedToConcrete)\nConcretePJRTArray{Float64, 1, 1}}, but AT !<: AbstractArray{T} and type\npromotion doesn't solve this.\n```\n\n* test\n\n* fix for PJRT",
